// pages/CategoryPage.js
import React from 'react';
import { useParams } from 'react-router-dom';
import './CategoryPage.css';

const CategoryPage = () => {
  const { id } = useParams();

  const letterMap = {
    'ก-ช': ['ก', 'ข', 'ฃ', 'ค','ฅ', 'ฆ', 'ง', 'จ', 'ฉ', 'ช', ''],
    'ฌ-ถ': ['ฌ', 'ญ', 'ฎ', 'ฏ', 'ฐ', 'ฑ', 'ฒ', 'ณ', 'ด', 'ต', 'ถ'],
    'ท-ม': ['ท', 'ธ', 'น', 'บ', 'ป', 'ผ', 'ฝ', 'พ', 'ฟ', 'ภ', 'ม'],
    'ย-ฮ': ['ย', 'ร', 'ล', 'ว', 'ศ', 'ษ', 'ส', 'ห', 'ฬ', 'อ', 'ฮ'],
    'สระ': ['อะ', 'อา', 'อิ', 'อี', 'อึ', 'อือ', 'เอะ', 'เอ', 'แอะ', 'แอ', 'โอะ', 'โอ', 'เอาะ', 'ออ'],
    'วรรณยุกต์': ['่', '้', '๊', '๋', '็', '์', '๐', '๑', '๒', '๓', '๔', '๕', '๖', '๗', '๘', '๙'],
  };

  const letters = letterMap[id] || [];

  return (
    <div className="category-page">
      <h2>{id}</h2>
      <div className="letter-grid">
        {letters.map((letter, index) => (
          <button key={index} className="letter-button">{letter}</button>
        ))}
      </div>
    </div>
  );
};

export default CategoryPage;
